<#
.SYNOPSIS
PMC TUI Working Package - Self-Extracting Archive

.DESCRIPTION
Self-extracting PowerShell package for PMC TUI working directory.
Contains the fixed version with ClassLoader and all improvements from Dec 9, 2024.

FIXES INCLUDED:
- Smart ClassLoader with auto-discovery and dependency resolution
- All 19 widgets now loaded automatically (was only 11)
- Fixed "Unable to find type" errors for Time/Tools/Options menus
- Multi-pass dependency loading with retry logic
- Automatic test file exclusion
- Comprehensive logging and diagnostics

This script extracts the working directory to the specified path.

.PARAMETER DestinationPath
Where to extract (default: ./pmc-working)

.EXAMPLE
.\pmc-working-package.ps1
.\pmc-working-package.ps1 -DestinationPath C:\pmc-test
#>

param(
    [string]$DestinationPath = "./pmc-working"
)

Set-StrictMode -Version Latest
$ErrorActionPreference = 'Stop'

