Write-Host "2. Start the TUI with logging (recommended for first run):" -ForegroundColor White
Write-Host "   .\Start-PmcTUI.ps1 -DebugLog -LogLevel 2" -ForegroundColor Yellow
Write-Host ""
Write-Host "3. Or start normally:" -ForegroundColor White
Write-Host "   .\Start-PmcTUI.ps1" -ForegroundColor Yellow
Write-Host ""
Write-Host "4. Check ClassLoader statistics:" -ForegroundColor White
